  }), mdx("p", null, "\uC624\uD310\uC744 \uD558\uAC70\uB098, \uBB34\uB2A5\uC744 \uBCF4\uC600\uAC70\uB098, \uD6C4\uD68C\uB97C \uB0A8\uACBC\uB2E4\uBA74 \uB098\uB294 \uC2A4\uC2A4\uB85C\uB97C \uAC1C \uBA4D\uCCAD\uD558\uB2E4\uACE0 \uBE44\uB09C\uD558\uACE0 \uB180\uB9AC\uBA70 \uC8FD\uC744 \uAC83 \uAC19\uC740 \uB9C8\uC74C\uC73C\uB85C \uD558\uB8E8\uB97C \uC2DC\uC791\uD558\uAC70\uB098 \uB9C8\uCE5C\uB2E4."), mdx("p", null, "\uB098\uB294 \uB098\uC5D0\uAC8C \uC88B\uC740 \uB9D0\uC744 \uD574\uC8FC\uB294 \uB300\uC2E0\uC5D0 \uC2A4\uC2A4\uB85C\uB97C \uBAB0\uC544\uC138\uC6B0\uACE0 \uB2E6\uB2EC\uD558\uB294 \uAC83\uC744 \uB354\uC6B1 \uACAC\uB51C \uC218 \uC788\uAC8C \uBAB8\uACFC \uB9C8\uC74C\uC744 \uAE38\uB800\uB2E4. \uD558\uB8E8\uB97C \uB9DD\uCE58\uBA74 \uADC0\uAC13\uAE38\uC5D0 \uCD5C\uC120\uC744 \uB2E4\uD574 \uB098\uB97C \uC695\uD558\uACE0, \uC9D1\uC5D0 \uB4E4\uC5B4\uC640 \uC637\uC744 \uAC08\uC544\uC785\uACE0 15km \uC774\uC0C1\uC744 \uB6F4\uB2E4. \uC774\uB807\uAC8C \uD558\uBA74 \uBAB8\uC774 \uBAB9\uC2DC \uC9C0\uCCD0\uC11C \uC2A4\uC2A4\uB85C\uB97C \uBE44\uB09C\uD560 \uC815\uC2E0\uC774 \uB0A8\uC544\uB098\uC9C8 \uC54A\uC544 \uB098\uB97C \uC9C0\uD0AC \uC218 \uC788\uB2E4."), mdx("p", null, "\uC2A4\uC2A4\uB85C\uB97C \uC2EC\uD558\uAC8C \uBE44\uB09C\uD558\uB294 \uAC83\uC774, \uB0B4\uAC00 \uB098\uC5D0\uAC8C \uCC38 \uBABB\uD574\uC900\uB2E4 \uC2F6\uC5B4\uC11C \uACE0\uCE58\uACE0 \uC2F6\uC5C8\uB358 \uBC84\uB987\uC774\uC9C0\uB9CC \uC624\uB798\uB3C4\uB85D \uC798 \uB418\uC9C4 \uC54A\uC558\uB2E4. \uC774\uC81C\uB294 \uADF8\uB9CC\uB450\uB824\uB294 \uC2DC\uB3C4\uB4E4\uB9C8\uC800 \uB2E4 \uB54C\uB824\uCCE4\uB2E4."), mdx("p", null, "\uC720\uD29C\uBE0C\uB098 \uD31F\uCE90\uC2A4\uD2B8\uC5D0\uC11C \uC2A4\uC2A4\uB85C\uC5D0\uAC8C \uC88B\uC740 \uB9D0 \uD574\uC8FC\uACE0 \uACA9\uB824\uD574\uC8FC\uB77C\uB294 \uB9D0 \uB108\uBB34 \uB9CE\uC774 \uB4E3\uB294\uB2E4. \uC544\uBB34\uB798\uB3C4 \uADF8\uB807\uAC8C \uD558\uB294\uAC8C \uC88B\uACA0\uC9C0? \uC0DD\uAC01\uD558\uBA70 \uB0B4 \uC131\uACA9\uC740 \uC65C \uC774\uB530\uAD6C\uC778\uC9C0 \uACE0\uBBFC\uD588\uB2E4. \uC65C \uB098\uB294 \uB098\uC5D0\uAC8C \uC88B\uC740 \uB9D0\uC744 \uBABB\uD574\uC8FC\uC9C0? \uBE68\uB9AC \uB108\uB97C \uC798 \uACA9\uB824\uD574! \uBD80\uB465\uBD80\uB465 \uD574\uC918! \uD558\uBA70 \uC2A4\uC2A4\uB85C\uB97C \uBE44\uB09C\uD558\uB294 \uB0B4 \uC790\uC2E0\uC744 \uBCF4\uC558\uB2E4. \uADF8\uB798\uC11C \uADF8\uB0E5 \uB2E4 \uB54C\uB824\uCCE4\uB2E4."), mdx("p", null, "\"\uBAA8\uB4E0 \uAC83\uC744 \uB530\uC9C0\uACE0 \uB098\uBA74 \uB09C \uBD84\uBA85\uD788 \uC798 \uBABB\uD558\uB294 \uAC83\uC774 \uC788\uC73C\uB2C8 \uAE5D\uCE58\uBA74 \uC548 \uB41C\uB2E4.\"\uB77C\uACE0 \uC0DD\uAC01\uD55C\uB2E4. \uC774\uAC8C \uB0AE\uC740 \uC5D0\uACE0\uB77C\uACE0 \uD558\uB294 \uBB34\uC5C7\uC77C\uC9C0\uB3C4 \uBAA8\uB974\uACA0\uB2E4. \uAC00\uB054 \uCE5C\uAD6C\uB098 \uC9C0\uC778\uC774\uB098 \uBAA8\uB974\uB294 \uC0AC\uB78C\uC744 \uB9CC\uB0A0 \uB54C \uC740\uADFC\uD788 \uC790\uAE30 \uC790\uB791\uC744 \uD558\uAC70\uB098 \uC2A4\uC2A4\uB85C\uC758 \uC131\uCDE8\uB97C \uC790\uB791\uC2A4\uB7EC\uC6CC\uD558\uB294 \uD0DC\uB3C4\uB97C \uBCF4\uC774\uB294 \uACBD\uC6B0\uAC00 \uC788\uB294\uB370 \uC2E0\uAE30\uD558\uACE0 \uBD80\uB7FD\uB2E4. \uB09C \uC2A4\uC2A4\uB85C\uB97C \uB5B3\uB5B3\uD558\uAC8C \uC0DD\uAC01\uD560\uB9CC\uD55C\uAC8C \uBCC4\uB85C \uC5C6\uB2E4."), mdx("p", null, "\uBAB9\uC2DC \uAC00\uB054 \uD558\uB294 \uCEE4\uD53C\uCC57\uC5D0\uC11C\uB3C4 \uC0C1\uB300\uBC29\uC5D0\uAC8C \uB0B4 \uC131\uACFC\uB97C \uB9D0\uD574\uC57C \uD560 \uB54C\uBA74 \uACFC\uB3C4\uD558\uAC8C \uCB48\uBF1B\uB304\uB2E4. \uBA58\uD1A0\uB9C1 \uAC19\uC740\uAC74 \uD560 \uC0DD\uAC01\uC774 \uC5C6\uB294\uB370 \uC9C0\uAE08\uB3C4 \uC798 \uBABB\uD558\uACE0 \uC788\uB294 \uB098\uC5D0\uAC8C\uC11C \uBB34\uC5C7\uC744 \uBC30\uC6B8 \uC218 \uC788\uC744\uAE4C \uC2F6\uC5B4\uC11C\uB2E4."), mdx("p", null, "\uC790\uAE30 \uD610\uC624\uB97C \uD1B5\uD574 \uBAB8\uACFC \uB9C8\uC74C\uC744 \uAF64\uB098 \uBD80\uC815\uC801\uC778 \uBC29\uC2DD\uC73C\uB85C \uAC15\uD654\uD588\uB2E4. \uAF64 \uC798 \uACAC\uB518\uB2E4. \uC2A4\uC2A4\uB85C\uB97C \uBE44\uB09C\uD558\uB294 \uB098 \uC790\uC2E0\uC744 \uBE44\uB09C\uD558\uB294 \uD589\uC704 \uC815\uB3C4\uB294 \uC880 \uC548 \uD558\uAC8C \uB418\uAE34 \uD588\uB2E4. \uB0B4 \uBCF8\uB798 \uBAA8\uC2B5\uC774\uB77C\uACE0 \uC0DD\uAC01\uB418\uB294 \uAC83\uC744 \uB9CE\uC774 \uBC1B\uC544\uB4E4\uC778 \uB355\uBD84\uC774\uB2E4. \uC0AC\uB78C \uC131\uACA9\uC744 \uC774\uB8E8\uB294 \uC5B4\uB5A4 \uBD80\uBD84\uB4E4\uC740 \uACE0\uCE60 \uC218\uAC00 \uC5C6\uACE0 \uADF8\uB0E5 \uBC1B\uC544\uB4E4\uC774\uBA70 \uC0B4\uC544\uC57C \uD55C\uB2E4."), mdx("p", null, "\uC88B\uC740 \uC810 \uBA87\uAC1C\uB294 \uB69C\uB837\uD558\uB2E4. \uAC15\uC81C\uB85C \uACB8\uC190\uD574\uC9C4\uB2E4. \uADFC\uB370 \uC9C4\uC9DC\uB85C \uB0B4\uC0C8\uC6B8\uAC8C \uC5C6\uB294 \uC0AC\uB78C\uC774\uB2E4. \uC5B4\uB5A4 \uC21C\uAC04\uC758 \uC5B4\uB5A4 \uC7A5\uC18C\uC5D0\uC11C\uB3C4 \uB09C \uBB34\uC5B8\uAC00 \uBABB \uD558\uACE0 \uC788\uB2E4. \uADF8\uAC83\uC774 \uC624\uB298 \uB108\uBB34 \uD53C\uACE4\uD558\uACE0 \uADC0\uCC2E\uC544\uC11C \uC9D1\uC744 \uBABB \uCE58\uC6B0\uACE0 \uC7A4\uB2E4 - \uB294 \uC815\uB3C4\uC758 \uAC83\uC77C\uC9C0\uB77C\uB3C4."), mdx("p", null, "\uCE6D\uCC2C\uC744 \uAE30\uB300\uD558\uC9C0 \uC54A\uAC8C \uB41C\uB2E4. \uC138\uC0C1\uC5D4 \uCE6D\uCC2C\uC744 \uC798 \uBABB \uB4E3\uB294 \uC0AC\uB78C\uC774 \uC788\uC9C0\uB9CC \uCE6D\uCC2C\uC744 \uC798 \uBABB \uBBFF\uB294 \uB098\uAC19\uC740 \uC0AC\uB78C\uB3C4 \uC788\uB2E4. \uC5B4\uB5A4 \uC21C\uAC04\uC758 \uC5B4\uB5A4 \uC7A5\uC18C\uC5D0\uC11C\uB3C4 \uB09C \uBB34\uC5B8\uAC00 \uBABB \uD558\uACE0 \uC788\uB2E4. \uCE6D\uCC2C\uD560 \uAC8C \uC788\uC744\uB9AC\uAC00 \uC5C6\uB2E4."), mdx("p", null, "\uB9DD\uD574\uAC00\uB294 \uD68C\uC0AC\uC5D0\uC11C \uD5C8\uC6B0\uC801\uB300\uAC70\uB098 \uD588\uB358 \uADF9\uB2E8\uC801\uC778 \uC0C1\uD669\uC744 \uC81C\uC678\uD558\uBA74, \uC0AC\uD68C\uC0DD\uD65C\uC5D0\uC11C \uB204\uAD70\uAC00\uC758 \uACA9\uB824\uAC00 \uD544\uC694\uD588\uB358 \uC21C\uAC04\uC774 \uAC70\uC758 \uC5C6\uB2E4. \uBC14\uB77C\uC9C0\uB3C4 \uC54A\uB294\uB2E4. \uB300\uBD80\uBD84\uC758 \uC21C\uAC04 \uC2EC\uB9AC\uC801\uC73C\uB85C \uC790\uC0DD\uD588\uB2E4. \uB208 \uB728\uACE0 \uBABB \uBD10\uC904 \uC815\uB3C4\uC758 \uACFC\uAC70\uC758 \uB098\uC640 \uC870\uAE08 \uB098\uC544\uC9C4 \uC624\uB298\uC758 \uB098\uB97C \uBE44\uAD50\uD558\uBA70 \uC5B4\uB290 \uC815\uB3C4\uCBE4 \uC0AC\uB78C\uC774 \uB418\uC5C8\uB294\uC9C0 \uD5E4\uC544\uB824 \uBCF4\uB294 \uAC83\uC774, \uCE6D\uCC2C\uBCF4\uB2E4 \uD6E8\uC52C \uB3D9\uAE30\uBD80\uC5EC\uAC00 \uB41C\uB2E4."), mdx("p", null, "\uADF8\uB798\uC11C \uB204\uAD70\uAC00\uB97C \uC798 \uACA9\uB824\uD558\uC9C0\uB3C4 \uBABB\uD55C\uB2E4. \uC8FC\uC704 \uC0AC\uB78C\uB4E4 \uD798\uB0B4\uAC8C \uD560 \uC218 \uC788\uB294 \uC0AC\uB78C\uC774 \uB418\uC5C8\uC73C\uBA74 \uC88B\uACA0\uB2E4\uACE0 \uC0DD\uAC01\uD558\uBA70, \uC9C1\uC7A5\uACFC \uC0DD\uD65C\uC5D0\uC11C \uBCF4\uB2E4 \uBF40\uC9DD\uD55C \uB9AC\uC561\uC158\uACFC \uD568\uAED8 \uD638\uB4E4\uAC11\uC744 \uB5A8\uAE30\uB3C4 \uD588\uB2E4."), mdx("p", null, "\uC9C0\uAE08 \uC774 \uAE00\uC744 \uC4F0\uBA74\uC11C\uB3C4, \uC2A4\uC2A4\uB85C\uB97C \uC2EB\uC5B4\uD558\uB294 \uC131\uACA9\uC774 \uCFE8\uD558\uACE0 \uC0AC\uB294\uAC8C \uC9C0\uC7A5\uC5C6\uB2E4\uACE0 \uC0DD\uAC01\uD574\uC11C \uB0B4\uC2EC \uC774\uAC83\uC744 \uBED0\uAE38 \uC758\uB3C4\uB85C \uBE14\uB85C\uADF8\uC5D0 \uC774\uB7F0 \uBED8\uAE00\uC744 \uC4F0\uACE0 \uC788\uB294\uAC70 \uC544\uB2C8\uB0D0\uBA70 \uC2A4\uC2A4\uB85C\uB97C \uBE44\uB09C\uD558\uACE0 \uC788\uB2E4."));
